import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="wrapper">
      <div className="App">
        <header className="App-header">
          <h1>List of Charactors</h1>
        </header>
        <content className="App-body">
          <h1>List of Charactors</h1>
        </content>
      </div>
    </div>
  );
}

export default App;
